class/accessor.html.body:
存取器
Dart支持通过getters/setters来截取对对象成员的访问。它能帮助你有效的控制对对象成员的访问。   
下面来看如何把一个简单的类改写成使用get和set。首先我们从一个没有使用存取器的例子开始。   
Dart
class Employee {
  String fullName;
}

main(List args) {
  var employee = new Employee();
  employee.fullName = 'Crixus Shen';
  print('${employee.fullName}');
}


TypeScript
class Employee {
  fullName: string
}

var employee = new Employee()
employee.fullName = 'Crixus Shen'
console.log(employee.fullName)


我们可以随意的设置fullName，这是非常方便的，但是这也可能会带来麻烦。   
下面这个版本里，我们先检查用户密码是否正确，然后再允许其修改员工信息。我们把对fullName的直接访问改成了可以检查密码的set方法。我们也加了一个get方法，让上面的例子仍然可以工作。   
Dart
const passcode = 'secret passcode';

class EmployeeOptimize {
  String _fullName;

  get fullName {
    return this._fullName;
  }

  set fullName(String newName) {
    if (passcode == 'secret passcode') {
      this._fullName = newName;
    } else {
      print('Error: Unauthorized update of employee!');
    }
  }
}

main(List args) {
  var employee = new EmployeeOptimize();
  employee.fullName = 'Crixus Shen';
  print('${employee.fullName}');
}


TypeScript
const passcode = 'secret passcode'

class EmployeeOptimize {
  private _fullName: string

  get fullName(): string {
    return this._fullName
  }

  set fullName(newName: string) {
    if (passcode == 'secret passcode') {
      this._fullName = newName
    } else {
      console.error('Error: Unauthorized update of employee!')
    }
  }
}

var employee = new EmployeeOptimize()
employee.fullName = 'Crixus Shen'
console.log(employee.fullName)


我们可以修改下密码，来验证存取器是否可以正常工作。当密码不对时，会提示我们没有权限修改员工。   
只带有get不带有set的存取器自动会被推断为readonly。

class/class-variable.html.body:
类变量
除了实例变量，类也可以定义类变量。一个类只有一份类变量的副本，无论它有多少个实例。即使类没有实例，类变量也是存在的。   
类变量的声明是在变量名前放置单词static。我们可以添加一个类变量来跟踪有多少个实例被创建。   
Dart
class Box {
  static var numberOfInstances = 0;
  Box() {
    ++numberOfInstances;
  }
}

main(List args) {
  var box1 = new Box();
  var box2 = new Box();
  Box.numberOfInstances == 0 ? print('No boxes yet') : print('We have boxes!');
}


TypeScript
class Box {
  static numberOfInstances = 0
  constructor() {
    ++Box.numberOfInstances
  }
}

var box1 = new Box()
var box2 = new Box()
Box.numberOfInstances == 0 ? console.log('No boxes yet') : console.log('We have boxes!')


在这里，每当类构造函数Box()运行时，它就会增加已创建箱子的实例数量。   
像实例变量，类变量从不直接引用。所有对它们的访问都是通过存取器。   
在它的声明类中，类变量可以通过名称直接引用（注意ts中可不是这样的）。在类的外部，只能通过变量名前加上类名来访问。   
类变量通常也被成为“静态变量”，但“静态变量”这个术语也包括了类变量与顶层变量。为了避免混淆，我们还是使用“类变量”来称呼。经常也会用“字段”这个术语来统称实例和类变量。   
类变量是延迟初始化的，在getter第一次被调用时类变量才执行初始化，即第一次尝试读取它时。与其他变量一样，如果一个类变量没有被初始化，则它会被默认初始化为null。   
类变量的延迟初始化有助于避免一个典型的问题：过量的前期初始化导致应用程序启动缓慢。然而延迟初始化也会导致出乎意料的行为。假设一个类变量在被赋值之前就被读取，就像下面的例子（例子中使用的是顶层变量而非类变量，但他们的行为是一致的）：   
Dart
class Cat {}
class DeadCat extends Cat {}
class LiveCat extends Cat {
  LiveCat() {
    print("I'm alive!");
  }
}
Cat schrodingers = new LiveCat();

main(List args) {
  schrodingers = new DeadCat();
}


TypeScript
class Cat {}
class DeadCat extends Cat {}
class LiveCat extends Cat {
  constructor() {
    super()
    console.log("I'm alive!")
  }
}
// ts中没有顶层变量的说法，因此这里会被执行
var schrodingers = new LiveCat()
schrodingers = new DeadCat();


上面的ts例子中，由于ts中并没有顶层变量，因此它会被执行，但是它们的语法是相近的。   
此处schrodingers的初始化永远不会被执行，并且对print()的调用也永远不会执行。而在我们实际开发中，开发者可能会检查schrodingers变量的值，那样就会触发变量的初始化。开发者应该始终密切关注延迟初始化带来的性能影响而适当的进行使用。

class/class-method.html.body:
类方法
类方法是不依赖于个体实例的方法。在讨论类变量时我们已经遇到了一些类方法。        
Dart
import 'dart:math';
class PointClassMethod {
  var rho, theta;
  PointClassMethod(this.rho, this.theta);
  x() => rho * cos(theta);
  y() => rho * sin(theta);
  static distance(p1, p2) {
    var dx = p1.x() - p2.x();
    var dy = p1.y() - p2.y();
    return sqrt(dx * dx + dy * dy);
  }
}

main(List args) {
  var aPoint = PointClassMethod(3, 30);
  var anotherPoint = PointClassMethod(4, 30);
  var _distance = PointClassMethod.distance(aPoint, anotherPoint);
  print(_distance); // 0.9999999999999999
}


TypeScript
class PointClassMethod {
  constructor(public rho: number, public theta: number){}
  x() {
    return this.rho * Math.cos(this.theta)
  }
  y() {
    return this.rho * Math.sin(this.theta)
  }
  static distance(p1, p2) {
    const dx = p1.x() - p2.x()
    const dy = p1.y() - p2.y()
    return Math.sqrt(dx * dx + dy * dy)
  }
}

const aPoint = new PointClassMethod(3, 30);
const anotherPoint = new PointClassMethod(4, 30);
const _distance = PointClassMethod.distance(aPoint, anotherPoint);
console.log(_distance); // 0.9999999999999999


用户定义的类方法在声明它们的类中是可用的，在类外只能将它们所在的类作为前缀才能访问，例如PointClassMethod.distance(aPoint, anotherPoint)。    
在类方法中使用this将导致编译错误。因为一个类方法不特定于任意实例，所以this在其内部是未定义的。     

最后有一点需要牢记，类变量和类方法从不被继承。

class/final-variable.html.body:
final变量
Dart的变量可以使用单词final作为前缀，表示它们在初始化之后就不允许再修改。final字段有getter但是没有setter。final类变量必须在声明时就进行初始化。   
final实例变量必须在任何实例方法运行前进行初始化。实现这一点有几种方法。第一种是在声明变量时就进行初始化，例如：   
Dart
final originPoint = new Point(0, 0);


TypeScript
const originPoint = new Point(0, 0)


这种方式不一定总是很方便。在不同的构造函数中，设置这个变量的方式可能不一样。例如，这个变量可能取决于构造函数的参数。如果想把final实例变量设置为构造函数参数的值，则可以使用普通的构造函数简写。作为例子，考虑下面这个Point类，它标识不可变的点：    
Dart
class Point {
  final x, y;
  Point(this.x, this.y);
  // Point类的剩余代码 ...
}

final originPoint = new Point(0, 0);

main(List args) {
  // originPoint = new Point(0, 0); // 'originPoint', a final variable, can only be set once.
}


TypeScript
class Point {
  readonly _x
  readonly _y
  constructor(x, y) {
    this._x = x
    this._y = y
  }
  // Point类的剩余代码 ...
}

const originPoint = new Point(0, 0)

// originPoint = new Point(0, 0) // Cannot assign to 'originPoint' because it is a constant.


不过某些情况下这还是不够。变量的值可能会取决于构造函数的参数，但又不完全相同，也就是说它们的值是基于构造函数参数计算得来的。试图给一个final实例变量赋值通常会导致一个名为NoSuchMethodError错误，因为赋值操作只是调用setter的语法糖，而final实例变量所对应的setter方法是没有定义的。单独声明一个对应的setter是可行的，它也会被调用。然而这对实例变量的值没有任何影响，在final变量初始化之后，它的值就无法改变了。   
大部分实例变量在声明时就被赋值并不再改变。因此大部分实例变量最好都声明为final。

class/equal.html.body:
相等操作符
所有对象都支持相等操作符==。这个操作符是在Object类中定义的，因此所有的类都继承了它，所以所有对象实例的行为都会包含它。先来看看下面这段代码：   
Dart
class Newer {
  final x, y;
  Newer(this.x, this.y);
}

main(List args) {
  var aNewer = new Newer(3, 4);
  var anotherNewer = new Newer(3, 4);
  print(aNewer == anotherNewer);  // false
}


TypeScript
class Newer {
  readonly _x;
  readonly _y;
  constructor(x, y) {
    this._x = x;
    this._y = y;
  }
}

const aNewer = new Newer(3, 4)
const anotherNewer = new Newer(3, 4)
console.log(aNewer == anotherNewer)  // false


这里其实存在一个基础概念问题，虽然在代码中aNewer和anotherNewer具有相同的x值和y值，换句话说两个对象可以是同一个类的实例，并且具有相同的状态和行为，但是它们仍然是不相同的。首先类对象是一个引用类型，引用类型和我们平时使用的基础类型（如int，string）不是一个概念,基础类型的变量存放在内存的栈内存区内，准确的来说是栈区内包含了变量的标识符和变量的值。但是引用类型就不同，引用类型的值是同时存储在栈内存区和堆内存区中的对象，更准确的说，引用类型的存储需要内存的栈区和堆区共同来完成，栈区内存保存变量标识符和指向堆区内存中的该对象的指针地址，也可以说是该对象在堆内存区内的地址。所以引用类型的比较其实是在比较两个对象在栈区中存储的堆内存地址。因此该代码的比较会返回false。    
其实笔者在这里主要解释了下强类型语言，例如C#中引用类型的概念，虽然在前端很少会听见引用类型这样的解释，但是并不代表它不存在，像JavaScript这样的语言同样存在引用类型概念，而且它们都是一样的解释，那么如何解决实例对象比较的问题呢？前面说过==是Object类的基础行为，所有实例都包含这个操作符，下面我们可以通过重写这个操作符来实现实例比较的问题：     
Dart
class Newer {
  final x, y;
  Newer(this.x, this.y);

  operator == (N) => this.x == N.x && this.y == N.y;
}

main(List args) {
  var aNewer = new Newer(3, 4);
  var anotherNewer = new Newer(3, 4);
  print(aNewer == anotherNewer);  // true，如果把`operator == (N) ...`这段代码注释则返回false
}


TypeScript
class Newer {
  readonly _x;
  readonly _y;
  constructor(x, y) {
    this._x = x;
    this._y = y;
  }

  public equals(obj: Newer) {
    return this._x == obj._x && this._y == obj._y
  }
}

const aNewer = new Newer(3, 4)
const anotherNewer = new Newer(3, 4)
console.log(aNewer == anotherNewer)  // false
console.log(aNewer.equals(anotherNewer))  // true


ts中由于并没有操作符概念，因此我们可以模仿C#来实现每一个基准类中的equals函数来实现同样的效果，当然在Dart中还存在一个identical()方法，它可以用来检查两个对象是否相同，它是比较hashCode的一种实现，这在C#中非常常见。

class/super-class.html.body:
父类
每个类都声明了一组实例成员，包括实例变量和各种实例方法。另外，每个类（Object类除外）继承了父类的实例成员。由于除了Object类外的所有类都只有一个父类，而Object类没有父类，所以Dart类层次结构形成了一个以Object类为根的树。这种结构被称为单继承。   
如果子类声明了一个与父类的某个方法同名的实例方法，那么可以说成子类重写了父类的方法。但是重写并不总是成立的，你不能用一个普通方法重写getter，这种情况会导致编译错误：    
Dart
class S {
  var v;
  final f = 0;
  get g => 32;
  set s(x) => v =2;
  m(a, b) => 91;
}

class C extends S {
  v() => 1; // 非法：方法v()重写隐含的getter方法v
  f() => 2; // 非法：方法f()重写隐含的getter方法f
  g() => 100; // 非法：方法g()重写getter方法g
  s(y) => 200;  // 非法：方法s()重写setter方法s
  m(a, b, c) => 92; // 警告：重写方法参数个数不一致
}


TypeScript
class S {
  protected v
  static f = 0
  get g() {
    return 32
  }
  set s(x) {
    this.v = 2;
  }
  m(a, b) {
    return 91
  }
}

class C extends S {
  v() {
    return 1  // 非法
  }
  f() {
    return 2  // 通过：ts并不会为静态变量默认设置一个getter
  }
  g() {
    return 100  // 非法
  }
  s(y) {
    return 200  // 非法
  }
  m(a, b, c) {
    return 92 // 非法
  }
}


试图用方法或getter重写setter，或者用setter重写方法或getter在技术上是不可行的。某些情况下，无意义的重写也会导致警告而不是编译错误。当一个重写方法比被重写的方法需要更多的参数时，Dart编译器将产生一个警告，但是代码仍然可以编程通过。

class/abstract.html.body:
抽象类与抽象方法
通常来说，简单的声明一个方法而不提供它的实现是有意义的，在某些继承关系的封装中这种形式非常常见，这种方法被称为抽象方法。任何种类的实例方法都可以被抽象化，不管它是getter、setter、操作符或普通方法。    
声明一个抽象方法将告诉代码的阅读者，这个方法只在代码运行时才可用。有一个抽象方法的类本身就是一个抽象类，抽象类的声明是通过在类名前加上前缀abstract。    
抽象类作为其它子类（或称为派生类）的父类（或称为基类）使用。它不能被实例化，毕竟它缺失部分实现，对它进行实例化会导致运行时错误，具体来说会产生一个名为AbstractClassInstantiationError的错误。不同于接口，抽象类可以包含成员的实现细节。   
Dart
abstract class Department {
  final name;
  Department(this.name) {

  }

  printName() {
    print('Department name: ${this.name}');
  }

  printMeeting();
}

class AccountingDepartment extends Department {
  AccountingDepartment(): super('Accounting and Auditing') {

  }

  // @override注解是可以省略的，但是还是加上，这样可以让阅读者更加语义化的理解
  @override
  printMeeting() {
    print('Generating accounting reports...');
  }

  generateReport() {
    print('Generating accounting reports...');
  }
}

main(List args) {
  Department department;  // 允许创建一个抽象类型的引用
  // department = new Department();  // 错误：不能创建一个抽象类的实例
  department = new AccountingDepartment();  // 允许对一个抽象子类进行实例化和引用赋值
  department.printName();
  department.printMeeting();
  // department.generateReport();  // 错误: 方法在声明的抽象类中不存在
}


TypeScript
abstract class Department {
  readonly name
  constructor(public _name: string) {
    this.name = _name
  }

  public printName() {
    console.log(`Department name: ${this.name}`);
  }

  // 抽象方法作为协议，最好也定义好你的预期返回类型
  public abstract printMeeting(): void;
}

class AccountingDepartment extends Department {
  constructor() {
    super('Accounting and Auditing')  // 在派生类的构造函数中必须调用 super()
  }

  public printMeeting(): void {
    console.log('Generating accounting reports...');
  }
}

let department: Department; // // 允许创建一个抽象类型的引用
// department = new Department();  // 错误：不能创建一个抽象类的实例
department = new AccountingDepartment();  // 允许对一个抽象子类进行实例化和引用赋值
department.printName();
department.printMeeting();
// department.generateReport();  // 错误: 方法在声明的抽象类中不存在


就运行时而言，抽象方法根本不存在。毕竟它们没有被实现，也无法被运行。调用抽象方法就与调用一个不存在的方法是一样的。    
Dart中还可以通过只包含抽象方法的抽象类来定义一个接口，这个将在后续展开讨论，这里不再讨论。

class/interface.html.body:
接口
每个类都隐含的定义了一个接口，此接口描述了类的实例拥有哪些方法。很多编程语言都有正式的接口声明，但在Dart中没有接口。笔者也觉得接口的设计确实属于很尴尬的设计，因为我们完全可以使用一个抽象类来实现我们的需求。    
与C#、TypeScript里接口的基本作用一样：    
Dart
abstract class ClockInterface {
  var currentTime;
  void setTime(DateTime d);
}

class Clock implements ClockInterface {
  @override
  var currentTime;

  @override
  void setTime(DateTime d) {
    this.currentTime = d;
  }
}

main(List args) {
  var clock = Clock();
  print(clock is ClockInterface);
}


TypeScript
interface ClockInterface {
  currentTime: Date
  setTime(d: Date)
}

class Clock implements ClockInterface {
  currentTime: Date

  setTime(d: Date) {
    this.currentTime = d
  }
}

const instanceOfClock = (props: any): props is ClockInterface => typeof (props as ClockInterface)['currentTime'] !== 'undefined'
var clock = new Clock()
console.log(instanceOfClock(clock))


请注意，is不检查对象是否为某个类或其子类的实例。相反，is检查对象的类是否明确的实现了某个接口，它可以用来判断类是否属于某种类类型。由于TS中不存在is关键词或者类似is的功能，有经验的工程师会问不是有一个instanceOf吗？由于instanceOf确实也是用来在运行时判断某个对象是否是特定类的一个实例，而interface在运行时时是不存在的，所以笔者采用了变通的方式来实现Dart中is的效果。    
一个类可以implements多个接口，这点也需要注意。在我们实际开发过程中，interface的运用要比上面的代码复杂的多。       
接口的继承
接口的继承类似于类。通俗的说，这可以让我们从一个接口里面复制成员到另一个接口里，可以更加灵活的将接口分割到可重用的模块内：    
Dart
abstract class Shape {  // 形状
  String color;
}

abstract class Square extends Shape { // 正方形
  int sideLength;
}

class Rhombus implements Square { // 菱形
  @override
  String color;

  @override
  int sideLength;
}

main(List args) {
  var rhombus = Rhombus();
  rhombus.color = 'red';
  rhombus.sideLength = 10;
}


TypeScript
interface Shape {
  color: string
}

interface Square extends Shape {
  sideLength: number
}

let rhombus = {}
rhombus.color = 'red'
rhombus.sideLength = 10


一个接口也可以继承多个接口，创建出多个接口的合成接口。可以看出implements的目的是在接口之间建立预期的关联，而不是共享实现。所以以上Rhombus类不是Square的子类，它没有继承Square的任何成员。

class/constructor.html.body:
构造函数
每个类至少有一个构造函数，构造函数的名称总是从我们想创建实例的类名开始的。构造函数可以由开发者明确地声明，或者也可以隐含地产生。在没有明确的构造函数被声明时，隐含的构造函数将被创建，它没有参数和函数体。     
声明一个和类名相同的函数（无名构造函数），来作为类的构造函数，注意一个类只能声明一个。            
Dart
class PointConstructor {
  num x;
  num y;

  PointConstructor(num x, num y) {
    this.x = x;
    this.y = y;
  }
}


TypeScript
class PointConstructor {
  x: number
  y: number

  constructor(x: number, y: number) {
    this.x = x
    this.y = y
  }
}


this关键字指向了当前类的实例，上面的代码可以简化为：     
Dart
class PointConstructor {
  num x;
  num y;

  PointConstructor(this.x, this.y);
}


TypeScript
class PointConstructor {
  constructor(public x: number, public y: number) {}
}


虽然是简写，但是它还是存在一定的差别。简写方式下针对x和y的赋值是发生在构造函数执行前的，所以如果成员变量是final，简写的意义就体现出来了。     
命名构造函数
Dart中没有重载，且只能声明一个无名构造函数，因此可以使用命名构造函数从另一个类或现有的数据中快速实现构造函数。而同样，在TypeScript中我们完全可以使用构造函数重载的模式来实现同样的功能。但是比较下来开发者会发现在实现中Dart由于是分隔开来实现的，而TS需要通过参数类型来区分不同的逻辑，从中可以看出Dart放弃了构造函数重载特性，通过命名构造函数的解决方案使代码看起来逻辑更加明确。        

重载：可通过传入不同的类型和个数的参数来返回不同类型的实例

Dart
class PointConstructor {
  num x;
  num y;

  PointConstructor(this.x, this.y);

  PointConstructor.fromJson(Map json) {
    x = json['x'];
    y = json['y'];
  }
}

main(List args) {
  var defaultPoint = new PointConstructor(3, 4);
  print('x: ${defaultPoint.x} y: ${defaultPoint.y}'); // x: 3 y: 4

  Map map = Map();
  map['x'] = 7;
  map['y'] = 8;
  var fromJsonPoint = new PointConstructor.fromJson(map);
  print('x: ${fromJsonPoint.x} y: ${fromJsonPoint.y}'); // x: 7 y: 8
}


TypeScript
class PointConstructor {
  x: number
  y: number

  constructor(x: number, y: number)
  constructor(json: Map)
  constructor(x?, y?) {
    if(typeof x === 'number') {
      this.x = x
      this.y = y
    }
    else if(typeof x === 'object') {
      this.x = x.get('x')
      this.y = x.get('y')
    }
  }
}

var defaultPoint = new PointConstructor(3, 4)
console.log(`x: ${defaultPoint.x} y: ${defaultPoint.y}`)  // x: 3 y: 4

const map = new Map()
map.set('x', 7)
map.set('y', 8)
var fromJsonPoint = new PointConstructor(map);
console.log(`x: ${fromJsonPoint.x} y: ${fromJsonPoint.y}`); // x: 7 y: 8


构造函数不能继承
Dart语言中，子类不会继承父类的命名构造函数，这和其他语言存在非常大的区别。如果不显式提供子类的构造函数，系统就会提供默认的构造函数，这个构造函数将会是没有参数没有实现的函数。    
调用父类的非默认构造函数
默认情况下，子类只能调用父类的无名、无参数的构造函数；父类的无名构造函数会在子类的构造函数前调用；如果“初始化列表”也同时定义了，则会先执行“初始化列表”中的内容，然后再执行父类的无名无参数构造函数，最后调用子类自己的无名无参数构造函数。     
如果父类不显式提供无名无参数构造函数，在子类中必须手动调用父类的一个构造函数（默认如果父类有无名无参数构造函数，则会被自动调用）。这种情况下，调用父类的构造函数的代码放在子类构造函数名后，子类构造函数体前，中间使用：分割。    
为什么要这么来设计？这是因为如果不执行父类的构造函数，那么父类的局部变量将不会被正确的初始化，从而会导致遇到未初始化的内存。      
Dart
import "dart:math";
class PointConstructor {
  num x;
  num y;

  PointConstructor(this.x, this.y);

  PointConstructor.fromJson(Map json) {
    x = json['x'];
    y = json['y'];
  }
}

class Point3DConstructor extends PointConstructor {
  final rho, theta;
  Point3DConstructor(x, y): rho = sqrt(x * x + y * y), theta=atan(x/y), super(x, y);
}

main(List args) {
  var point3D = new Point3DConstructor(1, 2);
  print('x: ${point3D.x} y: ${point3D.y} rho: ${point3D.rho} theta: ${point3D.theta}'); // x: 1 y: 2 rho: 2.23606797749979 theta: 0.46364760900080615
}


TypeScript
class PointConstructor {
  x: number
  y: number

  constructor(x: number, y: number)
  constructor(json: Map)
  constructor(x?, y?) {
    if(typeof x === 'number') {
      this.x = x
      this.y = y
    }
    else if(typeof x === 'object') {
      this.x = x.get('x')
      this.y = x.get('y')
    }
  }
}

class Point3DConstructor extends PointConstructor {
  readonly rho
  readonly theta
  constructor(x, y) {
    super(x, y)
    this.rho = Math.sqrt(x * x + y * y)
    this.theta = Math.atan(x/y)
  }
}

var point3D = new Point3DConstructor(1, 2);
console.log(`x: ${point3D.x} y: ${point3D.y} rho: ${point3D.rho} theta: ${point3D.theta}`); // x: 1 y: 2 rho: 2.23606797749979 theta: 0.4636476090008061


以上两种写法方式虽然执行结果是一致的，但是它们在执行上的先后顺序完全是不一致的。在Dart中，首先通过“初始化列表”依次对rho和theta成员变量进行了赋值操作，随后通过父类无名构造函数对父类中的成员变量x和y做了赋值操作，最后执行子类本身的构造函数体，由于没有实现因此整个流程提前结束。而在TS中相对比较复杂点，因为子类的构造函数可以完全重写父类相同命名相同参数的构造函数，但是一旦这样就必须在子类中通过super关键词进行手动调用父类的构造函数，就像上面这个示例，首先调用了父类的构造函数，然后才执行子类的构造函数，最后才对rho和theta进行了赋值。虽然两者在语法层面区别很大，但是最终实现的效果却是一样的。

class/redirect-constructor.html.body:
重定向构造函数
有时在逻辑处理过程中，我们想把执行重定向到另一个构造函数，但是又想保留旧的构造函数。可能这个类已经被一些陈旧的系统调用过，为了不破坏类本身的结构，可以通过重定向构造函数的方式来实现。     
现在我们有一个PointRedirect类，我们想通过两种模式来创建这个类对象，一种是通过极坐标的方式，而另一种则是通过传入直接坐标将其转化为极坐标的方式，请看下面的具体实现：    
Dart
import "dart:math";
class PointRedirect {
  var rho, theta;
  PointRedirect.polar(this.rho, this.theta);
  PointRedirect(a, b): this.polar(sqrt(a * a + b * b), atan(a/b));
}

main(List args) {
  var point1 = new PointRedirect(1, 2);
  print('rho: ${point1.rho} theta: ${point1.theta}'); // rho: 2.23606797749979 theta: 0.46364760900080615

  var point2 = new PointRedirect.polar(1, 2);
  print('rho: ${point2.rho} theta: ${point2.theta}'); // rho: 1 theta: 2
}


TypeScript
class PointRedirect {
  rho: number
  theta: number

  constructor(rho: number, theta: number)
  constructor(json: Map)
  constructor(x?, y?) {
    if(typeof x === 'number') {
      this.rho = x
      this.theta = y
    }
    else if(typeof x === 'object') {
      const a = x.get('a')
      const b = x.get('b')
      this.rho = Math.sqrt(a * a + b * b)
      this.theta = Math.atan(a/b)
    }
  }
}

var point1 = new PointRedirect(1, 2)
console.log(`rho: ${point1.rho} theta: ${point1.theta}`)  // rho: 1 theta: 2

const _map = new Map()
_map.set('a', 7)
_map.set('b', 8)
var point2 = new PointRedirect(_map)
console.log(`rho: ${point2.rho} theta: ${point2.theta}`)  // rho: 10.63014581273465 theta: 0.7188299996216245


在Dart这块的实现中，PointRedirect()就是一个重定向构造函数，这让我们保留了类原有的API。我们使用一个命名构造函数PointRedirect.polar()来生成使用新表现方式的点，它使我们得以保留旧的构造函数。我们将旧的构造函数转换为重定向构造函数，使它为我们生产改变了表示方式的点。但是和TypeScript的实现相比，Dart在这块的设计就表现的比较优雅，这得益于命名构造函数的重定向的设计。TS中只能通过构造函数重载的方式来实现，但是这就意味着在调用不同构造函数的时候必须使用不同类型甚至是不同参数个数的形参，否则无法区分到底调用的是哪一个构造函数。因此TS的实现代码看上去就相对比较冗余，而且构造函数的实现体完全通过形参类型来判断，耦合性非常的强，如果哪一天参数类型发生了变化，这段逻辑实现也需要同步更新，否则就会发生异常。而Dart只需要增加不同的命名构造函数即可，相对这样的处理方式对我们的风险更低更安全，同时也不会破坏原有类的API和结构。

class/factory-constructor.html.body:
工厂构造函数
当你需要一些类的实例，但是想以更加灵活一点的方式，而不是直接用硬编码的方式调用具体类型的构造函数的话，这时工厂模式就可以发挥作用。如果你已经有了一个实例也许只想返回之前已经缓存的实例，或许你想返回一个不同类型的对象。     
Dart支持这种模式，但不要求你改变创建对象时的样子。而是让你定义一个工厂构造函数。当你调用它的时候看起来像一个普通的构造函数。它没有初始化列表或初始化形式参数，它必须有一个返回一个对象（实例）的函数体，且工厂构造函数中不能使用this。例如：      
Dart
class Logger {
  final String name;
  static final Map _cache = {};

  factory Logger(String name) {
    if (_cache.containsKey(name)) {
      return _cache[name];
    } else {
      final logger = new Logger._internal(name);
      _cache[name] = logger;
      return logger;
    }
  }

  Logger._internal(this.name);
}

main(List args) {
  var logger1 = new Logger('smsLogger');
  var logger2 = new Logger('smsLogger');
  print(logger1 == logger2);  // true

  var logger3 = new Logger('mobiLogger');
  print(logger1 == logger3);  // false
}


TypeScript
class Logger {
  static readonly _cache: Map = new Map();

  static getInstance(name: string) {
    if (this._cache.has(name)) {
      return this._cache.get(name)
    } else {
      const logger = new Logger(name)
      this._cache.set(name, logger)
      return logger
    }
  }

  constructor(public name: string){}
}

const logger1 = Logger.getInstance('smsLogger')
const logger2 = Logger.getInstance('smsLogger')
console.log(logger1 == logger2);  // true

const logger3 = Logger.getInstance('mobiLogger')
console.log(logger1 == logger3);  // false


这里需要开发者注意一点，这里讨论的都是工厂构造函数概念，即只有Dart语法具有该特性。而不是工厂设计模式，请不要搞混。在TS中实现类似Dart的工厂构造函数，完全采用了硬编码的方式来实现，它并不能直接通过构造函数来创建不同的实例，只能通过定义静态函数的方式来实现类似的功能，虽然代码量看上去是差不多，但是从思想角度来说Dart表现的更为先进，通过不同的构造函数来实现不同的功效，因为大多数开发者并不知道类中的getInstance被设计为了一个缓存实例的工厂效果。

class/singleon-constructor.html.body:
单例构造函数
单例模式比较简单，它保证一个类只能有一个实例，并且提供一个全局的访问入口。采用单例模式的类应尽量保证无法被实例化，否则就缺失了单例的实际意义，因此开发者在定义单例类时不要去实现默认的无名构造函数：     
Dart
class Singleon {
  Singleon._();

  static Singleon _instance;

  static Singleon getInstance() {
    if (_instance == null) {
      _instance = Singleon._();
    }
    return _instance;
  }
}

main(List args) {
  // var singleonInstance = new Singleon(); // The class 'Singleon' doesn't have a default constructor.
  var singleonInstance = Singleon.getInstance();
  var singleonInstance2 = Singleon.getInstance();
  print(singleonInstance == singleonInstance2); // true
}


TypeScript
class Singleon {
  private constructor() {}

  private static _instance

  static getInstance(): Singleon {
    if (this._instance == null) {
      this._instance = new Singleon()
    }
    return this._instance
  }
}

// const singleonInstance = new Singleon()  // 类“Singleon”的构造函数是私有的，仅可在类声明中访问。
const singleonInstance = Singleon.getInstance()
const singleonInstance2 = Singleon.getInstance()
console.log(singleonInstance == singleonInstance2)  // true

class/const-constructor.html.body:
常量构造函数
有些对象是在编译时就可以计算的常量。其中许多是显而易见的字面量，如3.14159、“Hello World”等。     
Dart支持用户定义常量对象，如果类的对象不会发生变化，可以构造一个编译时的常量构造函数，定义格式如下：     

定义所有的实例变量是final
使用const声明构造函数
不能有函数体，可以有初始化列表

class Point {
  final x, y;
  const Point(this.x, this.y);
}

main(List args) {
  const origin = const Point(0, 0);
  // var origin2 = new Point(0, 0); // 这样也是可以的
  print(origin.x);
}

在适当的条件下，我们可以生成一个代表原点的Point常量对象。origin变量被声明为常量。我们只能把一个常量赋值给它。常量对象的创建是使用const而不是new。同new表达式一样，const表达式也是调用构造函数，但该构造函数必须是常量构造函数，而且它的参数必须是常量。实际上，Dart要求常量构造函数的参数必须是数字、布尔值或字符串。     
我们已经把Point的构造函数声明为常量。这会给类及构造函数加强一些非常严格的限制。我们需要一个状态不可变的类。此外一个常量构造函数不能有函数体。它可以有一个初始化列表，前提是只计算常量。     
回想一下之前的示例，我们不能将类似Point.polar()的构造函数定义为常量，因为它使用了像sqrt()这样的结果不是常量的函数。Point有这样一个构造函数是没有问题的，我们只是不能用const调用它而已。因此任意使用这个构造函数创建的点都不是常量。    
我们并不是总需要创建常量。事实上我们仍然可以使用new调用常量构造函数。如果我们这样做，则我们传递的参数不再受限制，但结果不再是常量。    
常量的值可以提前计算，只需一次，无需重新计算。Dart程序中的常量是规范化的，一个给定的值只会产生一份常量。

class/mixins.html.body:
Mixins
除了传统的面向对象继承方式，mixins是一个强大的概念，它允许我们跨多个类层次结构重用代码，而且这种层次结构支持交叉关系。     
这个概念相对比较难以理解，我们来看一个示例。我们这里有一个名为Animal的父类，它有三个子类（Mammal，Bird和Fish）。在底部，我们有具体的一些子类，每个子类具有不同的行为。例如有些动物有共同的行为：猫（Cat）和鸽子（Dove）都可以行走，但是猫不能飞。这些行为与此分类正交，因此我们无法在父类中实现这些行为。      
如果一个类可以拥有多个父类，那就很容易办到。我们可以创建另外三个类：Walker，Swimmer，Flyer。在那之后，我们只需让Cat继承Walker，Dove继承Walker和Flyer即可。但在Dart中，每个类（除了Object类）都只能有一个父类。    



我们需要一种在多个类层次结构中重用类的代码的方法。Mixins就能够办到这一点！   
Dart
// 动物
abstract class Animal {}
// 哺乳动物
abstract class Mammal extends Animal {}
// 鸟类
abstract class Bird extends Animal {}
// 鱼类
abstract class Fish extends Animal {}
// 跑的行为类
abstract class Walker {
  factory Walker._() => null;

  void walk() {
    print('I am walking');
  }
}
// 游的行为类
abstract class Swimmer {
  factory Swimmer._() => null;

  void swim() {
    print('I am swimming');
  }
}
// 飞的行为类
abstract class Flyer {
  factory Flyer._() => null;

  void fly() {
    print('I am flying');
  }
}

// 海豚
class Dolphin extends Mammal with Swimmer {}
// 蝙蝠
class Bat extends Mammal with Walker, Flyer {}
// 猫
class Cat extends Mammal with Walker {}
// 鸽子
class Dove extends Bird with Walker, Flyer {}
// 鸭子
class Duck extends Bird with Walker, Swimmer, Flyer {}
// 鲨鱼
class Shark extends Fish with Swimmer {}
// 文鳐鱼
class FlyingFish extends Fish with Swimmer, Flyer {}

main(List args) {
  Cat cat = Cat();
  cat.walk();

  Bat bat = Bat();
  bat.walk();
  bat.fly();
}


TypeScript
// 动物超类
abstract class Animal {}
// 哺乳动物超类
abstract class Mammal extends Animal {}
// 鸟类超类
abstract class Bird extends Animal {}
// 鱼类超类
abstract class Fish extends Animal {}
// 跑的混入类
abstract class  Walker {
  walk(): void {
    console.log('I am walking')
  }
}
// 游的混入类
abstract class  Swimmer {
  swim(): void {
    console.log('I am swimming')
  }
}
// 飞的混入类
abstract class  Flyer {
  fly(): void {
    console.log('I am flying')
  }
}

// 修饰器注入混入
function mixins(mixinObjs: any[]) {
  // TS通过帮助函数实现混入操作
  const applyMixins = (derivedCtor: any, baseCtors: any[]) => 
    baseCtors.forEach(baseCtor => {
      Object.getOwnPropertyNames(baseCtor.prototype).forEach(name => {
        derivedCtor.prototype[name] = baseCtor.prototype[name]
      })
    })
  return function(target) {
    applyMixins(target, mixinObjs)
  }
}

// 海豚
@mixins([Swimmer])
class Dolphin extends Mammal implements Swimmer {
  swim: () => void
}
// 蝙蝠
@mixins([Walker, Flyer])
class Bat extends Mammal implements Walker, Flyer {
  walk: () => void
  fly: () => void
}
// 猫
@mixins([Walker])
class Cat extends Mammal implements Walker {
  walk: () => void
}
// 鸽子
@mixins([Walker, Flyer])
class Dove extends Bird implements Walker, Flyer {
  walk: () => void
  fly: () => void
}
// 鸭子
@mixins([Walker, Swimmer, Flyer])
class Duck extends Bird implements Walker, Swimmer, Flyer {
  walk: () => void
  swim: () => void
  fly: () => void
}
// 鲨鱼
@mixins([Swimmer])
class Shark extends Fish implements Swimmer {
  swim: () => void
}
// 文鳐鱼
@mixins([Swimmer, Flyer])
class FlyingFish extends Fish implements Swimmer, Flyer {
  swim: () => void
  fly: () => void
}

const cat = new Cat()
cat.walk()

const bat = new Bat()
bat.walk()
bat.fly()


语法
我们明白了Mixins为什么如此有用，下面让我们看看如何创建和使用它们。     
Mixins通过普通的类声明隐式定义：      
class Walker {
  void walk() {
    print("I am walking");
  }
}

如果我们不想让我们创建的Mixins被实例化或者再扩展，我们可以把它定义为：     
abstract class Walker {
  factory Walker._() => null;

  void walk() {
    print("I'm walking");
  }
}

要使用Mixins的话，需要使用with关键字，后跟一个或多个Mixin的名称：     
class Cat extends Mammal with Walker {}

class Bat extends Mammal with Walker, Flyer {}

我们在Cat类上定义了Walker mixin，它允许我们调用walk()方法而不是fly()方法；但我们的Bat类却既可以调用walk()方法也可以调用fly()方法。虽然他们都是继承Mammal父类，但是我们并不能在Mammal父类去实现这2个方法，因为它们并不存在共性。      
main(List args) {
  Cat cat = Cat();
  cat.walk();
  // cat.fly();  // NoSuchMethod

  Bat bat = Bat();
  bat.walk();
  bat.fly();
}

趋势
Mixins在Dart中发展的非常快，以致于我们可以通过继承的方式来约束Mixins，看下面这段代码的实现：     
abstract class Super {
  void method() {
    print('Super');
  }
}

class MySuper implements Super {
  @override
  void method() {
    print('MySuper');
  }
}

mixin Mixin on Super {
  void method() {
    super.method();
    print('Sub');
  }
}

class Client extends MySuper with Mixin {

}

main(List args) {
  Client().method();
}

输出：     
MySuper
Sub

从上面可以看出，我们可以使用mixin关键字来定义个mixin object，同时通过on关键字来继承一个Super超类，此时该mixin就已经被Super超类所约束。这意味着之后在使用mixin时，混入mixin的类必须继承或实现Super，因为mixin中使用了Super.提供的功能。

library/top-layer.html.body:
顶层
通常来说，一个库由多个顶层声明组成，这些声明可以是函数、变量及类型（main函数也是一个顶层函数）。      
library stack1;
final _contents = [];
get isEmpty => _contents.isEmpty;

上面的示例中我们有一个顶层变量_contents，它被初始化为一个空列表。与实例变量和类变量一样，顶层变量也会引入一个隐含的存取器。同样，用户的代码不会被直接访问变量。因为顶层变量是延迟初始化的，与类变量是一样的，只有在它们的geeter第1次被调用时才会被执行初始化。所以_contents只有在某个访问它的方法被调用时才会被设置为[]。      
顶层变量和类变量一起被称为静态变量。它们的区别就在于作用域，即在什么范围内能够通过名称来对它们进行访问。类变量的作用域被限制在声明它的类中（甚至子类也无法访问它们），顶层变量（也叫库变量）的作用域则是覆盖了声明它们的整个库。库作用域通常由多个类与函数构成。      
与类变量一样，顶层变量也可以声明为final，在这种情况下，它们没有定义setter且必须在声明时就初始化。也可以把静态变量声明为常量，那样它们只能被赋予一个编译时常量且自身被视为不可变。     
顶层函数（也叫库方法）的作用域规则和顶层变量是一样的，在这个库中都是可用的，它可以是普通函数、getter和setter。除了顶层函数与变量，我们也可以声明顶层类。在Dart中类的声明都是顶层的，因为Dart并不支持类的嵌套。

library/private.html.body:
私有
库是Dart的基础封装单元。以下划线（_）开头的成员都是库私有的。在同一个File中可访问私有变量，但是在不同的File中则连编译都不能通过，类似TS中的private访问修饰符作用。     
这种方案使开发者、编译器或其他工具不必查看某个变量的声明就可以识别到它是否私有。在库的封装中，私有的定义非常重要，往往它可以用来保护我们的变量不被外界篡改。     
Dart
// library/private/1.dart:
class Bicycle {
  Bicycle(this.cadence, this.gear);
  int cadence;
  int _speed = 0;
  int gear;
}
class Test{
  void main() {
    final bike = Bicycle(2, 1);
    print(bike._speed);
  }
}

// library/private/2.dart:
import '1.dart';

void main() {
  final bike = Bicycle(2, 1);
  // print(bike._speed); // 编译报错
}


TypeScript
// library/private/1.ts:
class Bicycle {
  constructor(public cadence: number, public gear: number){}
  private readonly speed = 0
}

class Test {
  main(): void {
    const bike = new Bicycle(2, 1)
    // console.log(bike.speed) // 属性“speed”为私有属性，只能在类“Bicycle”中访问
  }
}

export default Bicycle

// library/private/2.ts:
import Bicycle from './1'

const bike = new Bicycle(2, 1)
// console.log(bike.speed);  // 属性“speed”为私有属性，只能在类“Bicycle”中访问。



区别：私有作用域在Dart中指库内部，而在TS中则指类内部。这一点需要加以区分。

library/import.html.body:
导入
我们通常可以将库作为模块导入到另外的库中进行使用。Dart的导入语句适用于任意URI。      
import './../relative/path/stack1.dart'

import 'http://xxxxx/stack1.dart'

尽管如此，我们仍然不推荐使用上面这种URI的方式。因为只要导入的库的位置发生了变化，就会影响到我们的代码。通常更严谨的做法是讲库作为包上传到包管理器中（类似NPM）。具体语法如下：    
import 'package:stack1.dart'

这种package:的导入方式会执行一个常驻的封装了代码位置信息的包管理器。Dart环境自带包管理器，这是一个官方的《包仓库源》。     
而对于Dart平台自身的库就没有必要使用package:方式，这些库都是通过dart:来访问的，它们都是内置的。例如：     
import 'dart:io'
import 'dart:html'
import 'dart:json'
...

库内可用的对象包含了库本身所声明的对象及通过导入语句从其他库导入的对象。dart:core中定义的对象是隐含导入的。       
命名空间
命名空间在一些后端语言中使用的非常普遍，它可以有效的隔离相同命名的函数声明，同时它让代码更加具有语义化。在Dart中针对一些歧义对象的使用我们可以使用命名空间来解决，通过as关键字我们可以很轻松的实现这一点，设想下我们现在有2个完全一模一样的库，库中的函数命名也是一致的，但是在调用时你可能会发现编译器会发出警告，因为编译器不知道你所调用的函数到底是哪个库的。现在我们可以这样来解决这个问题：     
Dart
// library/import/stack1.dart:
library stack1;
final _contents = [];
get isEmpty => _contents.isEmpty;
get last => isEmpty ? throw 'Cannot get top of empty stack' : _contents.last;
get pop => isEmpty ? throw 'Cannot pop empty stack' : _contents.removeLast();
push(e) {
  _contents.add(e);
  return e;
}

// library/import/stack2.dart:
library stack2;
final _contents = [];
get isEmpty => _contents.isEmpty;
get last => isEmpty ? throw 'Cannot get top of empty stack' : _contents.last;
get pop => isEmpty ? throw 'Cannot pop empty stack' : _contents.removeLast();
push(e) {
  _contents.add(e);
  return e;
}

// library/import/test.dart:
import 'stack1.dart' as stack1 hide isEmpty;
import 'stack2.dart' as stack2 show push, pop, last;

main(List args) {
  // 测试 stack1
  stack1.push('gently');
  stack1.push('harder');
  print(stack1.pop);
  print(stack1.last);
  // 测试 stack2
  stack2.push('gently');
  stack2.push('harder');
  print(stack2.pop);
  print(stack2.last);
}


TypeScript
// library/import/stack1.ts:
const _contents = []
const isEmpty = () => _contents.length === 0
const last = () => isEmpty() ? new Error('Cannot get top of empty stack') : _contents.reverse()[0]
const pop = () => isEmpty() ? new Error('Cannot pop empty stack') : _contents.pop()
const push = (e) => {
  _contents.push(e)
  return e
}

export {
  last,
  pop,
  push,
}

// library/import/stack2.ts:
const _contents = []
const isEmpty = () => _contents.length === 0
const last = () => isEmpty() ? new Error('Cannot get top of empty stack') : _contents.reverse()[0]
const pop = () => isEmpty() ? new Error('Cannot pop empty stack') : _contents.pop()
const push = (e) => {
  _contents.push(e)
  return e
}

export {
  last,
  pop,
  push,
}

// library/import/test.ts:
import { last, pop, push } from './stack1'
import { last as stack2_last, pop as stack2_pop, push as stack2_push } from './stack2'

// 测试 stack1
push('gently');
push('harder');
console.log(pop());
console.log(last());
// 测试 stack2
stack2_push('gently');
stack2_push('harder');
console.log(stack2_pop());
console.log(stack2_last());


命名空间组合器：show和hide
Dart提供了额外的机制来控制导入到库内的对象，大多数情况下，一些库会提供大量已实现的函数，但是我们可能只需要使用其中某几个函数，而没必要全部去导入它们。Dart通过show和hide关键字来操纵被导入的命名空间。      
library lib1;
import 'stack1.dart' hide isEmpty, top;

hide组合器接受一个命名空间和一个标识符列表，并将标识符列表中的对象从命名空间中丢弃，然后产生一个新的命名空间。正如上述示例，只有pop和push在lib1中可用，因为这里导入的命名空间不再是stack1完整导出的命名空间。      
library lib1;
import 'stack1.dart' show pop, push;

show组合器类似，除了只有在标识符列表中出现的对象会被保留在命名空间中。       
何时使用show，何时使用hide呢？如果你导入一个大型的库，而你指向使用其中的少数成员，那么你会发现show更加方便。相反，如果你试图解决库之间的一两个冲突，那么你可能会选择使用hide，但更好的方式是通过as引入前缀来避免冲突。

library/part.html.body:
库的拆分
有时一个库可能太大，不能方便的保存在一个文件中。Dart允许我们把一个库拆分成一个或者多个较小的part组件。或者我们想让某一些库共享它们的私有对象的时候，我们需要使用part。     
注意点：    

每个文件头上的part xxx和part of xxx是不能省略的。它可以为解释器指明它是某个库中的某个part。
part of所在文件不能包括import、library等关键字。

// library/part/part1.dart:
library part1;
import '../import/stack1.dart';

part 'part2.dart';

get output => 'Hello Part1!';

main(List args) {
  output2();
}

// library/part/part2.dart:
part of 'part1.dart';

output2() {
  // 共享了part1的命名空间
  push('gently');
  push('harder');
  print(pop);
  print(last);

  print(output);
}

输出：    
harder
gently
Hello Part1!

可以看出，part2是part1的part，可以理解为，part2是part1的一部分。在part2中我们并没有引入../import/stack1.dart包就可以直接继承该包中的所有导出对象。这是因为，在part中，凡是采用import关键字导入的库都是可以被共享命名空间的。     
不是所有的库都有名称，但如果使用part来构件库，那么库必须要命名。     
library xxx;

每个子part都存放在各自的文件中。但是它们共享同一作用域，库的内部命名空间，以及所有的导入（import）。      
part和import的区别

可见性：如果说在A库中import了B库，A库对B库是不可见的，也就是说B库是无法知道A库的存在的。而part的作用是将一个库拆分成较小的组件。两个或多个part共同构成一个库，它们彼此之间是知道互相的存在的。    
作用域：import不会完全共享作用域，而part之间是完全共享的。如果说在A库中import了B库，B库import了C库，A库是没有办法直接使用C库的对象的。而B，C若是A的part，那么三者共享所有对象，并且包含所有的导入。

library/export.html.body:
导出
我们可以使用export关键字导出一个更大的库。随着我们的项目不断发展并超出了我们的预期，我们就需要把单个库拆分成多个库。    
导出指令允许一个库使用来自其他命名空间的对象来扩充自己的导出命名空间。      
导出的规则与导入、part的规则相同：导出使用的URI必须指向一个库，而且必须是不可变的没有使用插值的字符串字面量。如果违反了这些要求，那么编译器就会报错。如果一个库使用多个导出语句来导出同一个对象，那么也是一个编译错误。     
// library/export/new-stack1.dart:
library newStack1;

export '../import/stack1.dart' show push;

// library/export/test.dart:
import 'new-stack1.dart';

main(List args) {
  push('gently');
  push('harder');
  // print(pop); // Undefined name 'pop'
  // print(last);  // Undefined name 'last'
}

library/defferred.html.body:
延迟加载
延迟（defferred）加载允许引用程序按需加载库。下面是当你可能会使用延迟加载的某些情况：     

为了减少应用程序的初始化启动时间；
执行A/B测试 - 尝试的算法的替代实施方式中；
加载很少使用的功能，例如可选的屏幕和对话框。

为了延迟加载一个库，必须使用defferred as 先导入它。当需要库时，使用该库的调用标识符调用loadLibrary()。         
Dart
// library/deferred/hello.dart:
library hello;

printGreeting() {
  return 'hello!';
}

// library/deferred/test.dart:
import 'hello.dart' deferred as hello;

greet() async {
  await hello.loadLibrary();
  return hello.printGreeting();
}

main(List args) {
  greet().then((e) => print(e));
}


TypeScript
// library/deferred/hello.ts:
export default async () => {
  return 'hello!'
}

// library/deferred/test.ts:
import printGreeting from './hello'

const greet = async () => await printGreeting()

greet().then(e => console.log(e))

// 这句代码与上面2句等价，上面只是为了展示async和await同步特性
// printGreeting().then(e => console.log(e))


在前面的代码中，在库加载好之前，await关键字会一直暂停后面的代码直到库被加载好。     
当然你可以在多次调用loadLibrary()，该库也只会被加载一次。     
当使用延迟加载时，请记住以下几点：     

延迟库的常量在其作为导入文件时不是常量。记住，这些常量不存在，直到延迟库被加载完毕。
调用loadLibrary()函数会返回一个Future对象（类似ES中的Promise对象）。

function/params.html.body:
参数
函数总是有一个形式参数列表，虽然这个参数列表可能为空，并且getter方法是没有参数列表的。参数要么是位置型的，要么是命名型的。    
位置参数
位置参数可以是必填的或可选的，下面是一些拥有必填参数的函数：     
Dart
// zero() => 0;
get zero => 0;  // 与上面是等效的
id(x) => x;
identity(x) {
  return x;
}
add(a, b) => a + b;


TypeScript
const zero = () => 0
const id = (x) => x
function identity(x) {
  return x
}
const add = (a, b) => a + b


可选参数必须排列在一起，放置在参数列表尾部并且用方括号包裹。任意必填参数都必须出现在可选参数前面，可选参数可以指定默认值但必须是编译时常量。     
Dart
increment(x, [step = 1]) => x + step;

main(List args) {
  print(increment(1));  // 2
  print(increment(2, 4)); // 6
  // print(increment()); // 运行时错误
  // print(increment(2, 3, 4));  // 运行时错误
}


TypeScript
const increment = (x, step = 1) => x + step

console.log(increment(1));  // 2
console.log(increment(2, 4)); // 6
// console.log(increment()); // 运行时错误
// console.log(increment(2, 3, 4));  // 运行时错误


命名参数
参数可以是位置参数或命名参数。命名参数一般用于参数是一个类似合集的情况，命名参数要在位置参数之后声明并用大括号包裹。     
Dart
// printCities(name1, { name2, name3 = "Guangzhou" }) {
//   print('Name 1 is $name1');
//   print('Name 2 is $name2');
//   print('Name 3 is $name3');
// }
printCities(name1, { name2, name3: "Guangzhou" }) { // 与上面是等效的，这里必须用双引号，不能用单引号
  print('Name 1 is $name1');
  print('Name 2 is $name2');
  print('Name 3 is $name3');
}

main(List args) {
  printCities('Beijing', name2: 'Shanghai');
}


TypeScript
function printCities(name1, { name2, name3 = 'Guangzhou' }) {
  console.log(`Name 1 is ${name1}`);
  console.log(`Name 2 is ${name2}`);
  console.log(`Name 3 is ${name3}`);
}

printCities('Beijing', { name2: 'Shanghai' });


输出：     
Name 1 is Beijing
Name 2 is Shanghai
Name 3 is Guangzhou

高阶函数
前面我们介绍过，函数可以作为参数传入也可以作为函数的输出，一般称其为高阶函数，下面是一个结合上面所有技能点编写的示例：     
Dart
var map = new Map();
fail() => throw('Key not found');
lookup(key, { ifMissing: fail }) {
  var result = map[key];
  if (result == null) return ifMissing();
  return result;
}

main(List args) {
  lookup('anything'); // 抛出错误
  lookup('anything', ifMissing: () => map['anything'] = 42);  // 42
}


TypeScript
let __map = new Map();
const fail = (): void => { throw new Error('Key not found') }
function lookup(key, { ifMissing = fail } = {}) {
  let result = __map[key]
  if (result == null) return ifMissing()
  return result
}

lookup('anything')  // 抛出错误
lookup('anything', { ifMissing: () => __map['anything'] = 42 }) // 42


可以看出我们将ifMissing作为命名参数，并且为它增加了一个默认值，该默认值是一个抛出异常的函数，在没有传递第二个参数时，该函数会自动执行fail()函数从而抛出一个Key not found的异常。由于第二个参数是一个可选参数，因此我们完全可以自定义该参数，为其实现一个自定义的函数实现。    

如果可选参数没有指定默认值，则它的值默认是null。

function/body.html.body:
函数体
函数体包含了函数在执行时需要计算的代码。函数体跟在函数签名之后，而且有两种形式，在前一章中我们已经看到过：     

大括号括起来的语句列表（可能为空）
=> 箭头符号后跟着的一个表达式

在第1种形式中，函数体从第1条代码开始执行，直到以下任意一种情况发生：函数最后一条代码被成功执行；一个return语句被执行，或者抛出一个没有被捕获的异常。         
Dart中的每个函数要么返回一个值，要么抛出一个异常。      
如果我们完成了最后一条语句，而且它不是return ，则我们将返回null。       
sideEffect() {
  print("I don't have a return and I don't throw an exception");
}

main(List args) {
  print(sideEffect());
}

输出：     
I don't have a return and I don't throw an exception
null  // js中则是返回undefined类型的值，非null值


这对于学习过JavaScript的同学而言，理解起来相对比较简单，因为JavaScript中就是这样的函数设计。

function/declaration.html.body:
函数声明
到目前为止，我们看到的大多数函数都是通过函数声明来进行介绍的，而构造函数、getter和setter例外。函数声明有一个函数名称，后面跟着参数列表和函数体。     
抽象方法有函数签名但是没有函数体。抽象方法从技术角度来说并不是函数声明。把它作为声明只是为了辅助静态检查器而言。      
函数声明可以出现在顶层或是作为方法存在，然而，函数也可以是局部函数。局部函数就是定义在其他函数内部的函数。请看下面的一个示例：     
Dart
fib(n) {
  sum(n) {
    if(n  args) {
  print(fib(5));  // 5+4+3+2+1=15
}


TypeScript
function fib(n) {
    function sum(n) {
        if (n 

这并不是一个计算值递减总和的最佳方式，但是它避免了幼稚的递归计算版本所带来的浪费。由于sum()只是fib()的一个实现细节，所以最好把sum()嵌入fib()中，以避免引入一个额外的函数名而使外层命名空间收到污染。

function/closure.html.body:
闭包
函数可以定义在表达式的内部。它们被称为函数字面量，也被称为闭包或者匿名函数。与函数声明不同，闭包没有函数名称。虽然如此，与其他函数一样，它们也有参数列表与函数体。      
(x) => x;
(x) { return x; }
(x, [step = 1]) => x + step;
(a, b) => a + b;

单看这些例子，可能不会马上明白闭包有多大的用处。它们看起来就像是没有名称的函数声明。而真正的好处则来自于将它们作为大型表达式的一部分。      
考虑一个列表元素求和的问题。我们可以使用for循环来实现这一点，但那时比较原始的实现方式。一个有经验的Dart开发者会这样去实现：     
Dart
main(List args) {
  _sum(List nums) => nums.reduce((a, b) => a + b);
  print(_sum([1, 2, 3, 4, 5, 6, 7, 8, 9, 0])); // 45
}


TypeScript
const _sum = (nums: number[]) => nums.reduce((a, b) => a + b)
console.log(_sum([1, 2, 3, 4, 5, 6, 7, 8, 9, 0]))


Dart中的列表及其他很多类型都定义了reduce()方法。任意实现了Iterable接口的类型应该都有一个可运行的内置函数reduce()。具体如何使用reduce你可以查询官方API的使用。我们在这里当然也可以不使用闭包来实现：     
sum(nums){  // 不好的代码风格
  plus(a, b) => a + b;
  nums.reduce(plus);
}

以上代码稍显啰嗦并需要我们明明一个额外的函数。在执行加法的情况下，函数的名称还是显而易见的，但对下面这样的函数进行命名就变得很繁重：      
country.cities.where((city) => city.population > 1000000);

这个函数可以找出所有country中人口数量大于一百万的城市。这段代码使用了where()方法，它也来自于Iterable，接受一个函数作为参数。在这种情况下，where()的参数必须是一个一元断言函数，而它将返回那些断言为真的元素。

function/call.html.body:
函数调用
函数可以通过标准的方式来调用，即在函数值表达式后面加上一个括号参数列表，例如：print('Hello World')。     
有些函数被称为getter，可以不使用参数列表来调用。     
true.runtimeType; // bool

在Dart中，方法与字段不是通过相同的语法来访问的。尽管getter和字段没有区别对待，摆正了表征独立，但getter与方法是通过不同的语法访问的。因此Dart开发者需要注意一个函数是被声明为getter还是一个无参数的方法。这种情况同样适用于setter。      
级联符号
除了平常使用点云算法来执行成员选择外，Dart也支持使用双点符号进行方法级联。当我们需要对一个对象执行一系列操作时，级联是非常有用的。来看下下面这个示例：     
var address = new Address.of("Freddy Kruger");
address.setStreet("Elm", "13a");
address.city = "Carthage";
address.state = "Eurasia";
address.zipCode(66666, extend: 66666);

我们可以使用级联符号来优化上面这段代码，它们是完全等效的：      
var address = new Address.of("Freddy Kruger");
..setStreet("Elm", "13a");
..city = "Carthage";
..state = "Eurasia";
..zipCode(66666, extend: 66666);

级联(..)允许我们对同一对象执行一系列操作。除了函数调用，我们还可以访问同一对象上的字段。这通常会省去创建临时变量的步骤，并允许我们编写更多的级联代码。     
另一种能用到级联的情况是当我们执行某个对象的方式时，我们需要的返回值是对象本身，但方法返回的却是其他值:           
Dart
main(List args) {
  // 数组的sort是一个void函数
  var sortedColors = ['red', 'green', 'blue', 'orange', 'pink'].sublist(1, 3)..sort();
  // 等价于
  // var sortedColors = ['red', 'green', 'blue', 'orange', 'pink'].sublist(1, 3);
  // sortedColors.sort();
  print(sortedColors);  // [blue, green]
}


TypeScript
// 数组的sort是一个返回排序后数组的函数
var sortedColors = ['red', 'green', 'blue', 'orange', 'pink'].slice(1, 3).sort();
console.log(sortedColors);  // [blue, green]

function/function-class.html.body:
Function类
Function是代表所有函数的公共顶层接口的抽象类。Function没有声明任何实例的方法，然而它声明了类方法apply()，此方法接受一个函数和一个参数列表，并使用提供的参数列表去调用传入的函数。     
apply()的签名是：     
static apply(Function function, List positionalArguments, [Map namedArguments]);

apply()的形式参数是带有类型注解的。它需要一个被调用的函数和一个位置参数的列表（可以为空）。明明参数可以通过一个名称与实际参数组成的map来提供，且实际参数可以是任意类型的对象。最后一个参数是可选的。大部分函数不需要任何命名参数，所以只在需要时才提供它们是比较方便的。      
apply()方法提供了一种使用动态确定的参数列表来调用函数的机制。通过它，我们可以处理在编译时参数列表数量不确定的情况：     
Dart
foo(a, b, c, { d, e: "fastman" }) {
  print('param a is: $a');
  print('param b is: $b');
  print('param c is: $c');
  print('param d is: $d');
  print('param e is: $e');
}

main(List args) {
  Function.apply(foo, [1, 2, 3], { #d: 4, #e: 5 });
}


TypeScript
function foo(a, b, c, { d, e = 'fastman' }) {
  console.log(`param a is: ${a}`);
  console.log(`param b is: ${b}`);
  console.log(`param c is: ${c}`);
  console.log(`param d is: ${d}`);
  console.log(`param e is: ${e}`);
}

foo.apply(null, [1, 2, 3, {
  d: 4,
  e: 5
}])


上面的示例，最终的执行结果我们可以把它近似为：     
foo(1, 2, 3, f: 4, g: 5);

输出：    
param a is: 1
param b is: 2
param c is: 3
param d is: 4
param e is: 5

function/generator.html.body:
生成器函数
Dart支持生成器，它是用来产生集合值的函数。生成器可以是同步或者异步的。同步的生成器为迭代器生成提供了语法糖，而异步的生成器则为流的生成提供的语法糖。     
这一章主要来讨论同步的生成器，后续章节会再讨论异步的生成器。     
迭代器
在讨论生成器之前，我们首先先要理解迭代器的概念。迭代器是允许对集合内容按顺序进行迭代的对象。支持通过迭代器进行迭代的集合被称为可迭代对象（即实现get iterator函数的对象），可迭代对象必须有一个名为iterator的用于返回迭代器的getter函数。    
for-in循环可以操作任意可迭代对象。     
迭代器接口和指针对象的接口分别被类Iterable和Iterator实现。     
Dart
interface Iterable {
  get iterator: Iterator;
}
interface Iterator {
  moveNext(): bool;
}


TypeScript
interface Iterable {
  [Symbol.iterator]() : Iterator,
}

interface Iterator {
  next(value?: any) : IterationResult,
}

interface IterationResult {
  value: any,
  done: boolean,
}


Iterator接口的目的，就是为所有数据结构提供一种统一的访问机制，即for-in循环。当使用for-in循环遍历某种数据结构时，该循环自动去寻找Iterator接口。      
迭代器的生成非常的公式化。我们需要定义一个可迭代的集合类且必须为它定义一个返回iterator的getter。该getter函数对应当前对象的遍历器对象。这个遍历器对象具有current成员属性和moveNext()方法的实现，其中current代表每次迭代所要输出的值，而moveNext()则是实现整个遍历处理的逻辑。具体请查看下面的示例来帮助理解：    
Dart
class NaturalsIterable extends Iterable {
  var n;
  NaturalsIterable.to(this.n);
  get iterator => new NaturalsIterator(n);
}

class NaturalsIterator extends Iterator {
  var n;
  var current = -1;
  NaturalsIterator(this.n);
  moveNext() {
    if (current  new NaturalsIterable.to(n);

main(List args) {
  for(var i in naturalsTo(20))
    print(i); 
}


