class NaturalsIterable {
  constructor(private n: number){}
  [Symbol.iterator]() {
    return new NaturalsIterator(this.n)
  }
}

class NaturalsIterator {
  private current = -1
  constructor(private n: number){}
  next() {
    if (this.current  new NaturalsIterable(n)

for(let i of naturalsTo(20)) {
  console.log(i)
}


