同步生成器
为了减少迭代器而导致的重复代码，Dart提供了同步生成器函数来简化迭代器的实现。使用同步生成器，让我们省去了即使是实现最基本的迭代器也需要定义两个类的麻烦。我们可以给函数体使用sync*修饰符来定义一个生成器函数：    
Dart
naturalsTo2(n) sync* {
  var current = -1;
  while (current  args) {
  for(var i in naturalsTo2(20)) {
    print(i);
  }
}


TypeScript
const naturalsTo2 = function* (n) {
  let current = -1
  while (current 

使用生成器的代码相比迭代器的实现简化了很多，生成器函数的调用方法与普通函数一样，也是在函数后面加上一对圆括号。不同的是，调用生成器函数后，该函数并不会执行，返回的也不是函数运行结果，而是一个指向内部状态的指针对象，即迭代器对象。      
下一步必须调用迭代器对象的moveNext方法，使得指针移向下一个状态。也就是说，每次调用moveNext方法，内部指针就从函数头部或上一次停下来的地方开始执行，知道遇到下一个yield表达式（或return语句）为止。换句话说，生成器函数是分段执行的，yield表达式是暂停执行的标记，而moveNext方法是可以恢复执行的标记。      
正如上面所说，同步生成器中的yield语句将对象追加到与之关联的可迭代对象，并暂停函数体的执行。只有通过调用与之关联的迭代器的moveNext()方法才能让函数再次执行。当yield暂停执行函数体时，moveNext()返回true给调用者。当生成器终止时，moveNext()返回false。

type/optional-type.html.body:
可选类型
Dart的类型是可选的（可以使用var来定义类型）。作为展示运行时行为取决于类型的语言特性，我们就需要先考虑下静态类型的方法重载。重载是静态面向对象语言（例如Java、C#）的常见特性，在这些语言中我们可以这么写：   
// 这是一段java代码的示例，但是Dart不支持重载:
class NotLegalDart {
  overloaded(List l) => l.length;
  overloaded(num n) => n * 2;
}

public static void main(String[] args) {
  int x = 3;
  new NotLegalDart().overloaded(x); // 6
  List l = [];
  new NotLegalDart().overloaded(l); // 0
}

在静态面向对象语言中我们期待通过参数的类型来区分方法的调用；但是在Dart中我们依靠什么来选择overloaded的实现呢？（类型不影响语义）但如果我们决定给变量添加类型，其行为就会发生改变，且仅仅是因为我们决定在方法调用处给代码添加类型注释而已。基于类型的重载即使在全静态语言中也是一个存在问题的功能，因为类型不影响语义，所以Dart不支持基于类型的重载。

type/parameter-type.html.body:
形参类型
Dart的变量可以与类型关联，类型也可以用来指示方法的返回类型，例如：   
Dart
int sum(int a, int b) => a + b;
main(List args) {
  print(sum(3, 4)); // 7
}


TypeScript
const sum = (a: number, b: number): number => a + b;
console.log(sum(3, 4)) // 7


当然我们也可以不使用类型来书写代码，下面是一段非常相似的代码，不同之处在于缺少类型注解：
Dart
sum(int a, int b) => a + b;
main(List args) {
  print(sum(3, 4)); // 7
}


TypeScript
const sum = (a: number, b: number) => a + b;
console.log(sum(3, 4)) // 7


这两个不同版本的行为是完全一致的，阅读代码的人能够受益于类型注解提供的文档，但Dart运行时对此并不关心。开发工具虽然可以通过不同的方式来利用类型注解：他们可以对可能存在的类型不一致发出警告，也可以通过多种方式帮助开发者。但是仅仅依靠类型检查就能够确保程序的准确性是不可能的，哪怕在非常严格类型检查的静态类型语言中同样存在下面的问题：   
Dart
int i;
int j = 0;
sum(a, b) => a + b;
main(List args) {
  print(sum(i, j)); // NoSuchMethodError: The method '+' was called on null.
}


TypeScript
let i: number
let j: number = 0
const sum = (a, b) => a + b
console.log(sum(i, j))  // NaN


上面这段代码不能运行，即使它有正确的类型。当然这种情况非常的普遍，如果我们仅仅依靠类型检查就能够确保程序的正确性，那么静态类型编程语言将拥有巨大的经济优势。虽然sum()没有被类型所注解，但是在某些定义了+方法的类型却是有意义的：   
Dart
sum(a, b) => a + b;
main(List args) {
  print(sum('abc', 'defg')); // abcdefg
}


TypeScript
const sum = (a, b) => a + b
console.log(sum('abc', 'defg')) // abcdefg


在这种情况下，为了可以避免过分的类型警告，最好的做法就是完全避免给sum()添加类型注解。

type/interface-type.html.body:
接口类型
Dart并没有声明接口的语法。接口是通过类声明引入的。每个类都引入了一个隐形接口，其签名是基于类的成员。对于传统接口声明的要求，我们定义一个"纯抽象类"就可以轻松解决。   
任何类都可以实现一个接口，即使该接口与类完全没有关联。这是Dart不需要接口声明语法的原因。implements子句所做的，是使类与它所列出的接口建立明确的子类关系，这种关系会影响Dart类型检查器及运行时的行为。   
我们来看看下面这个类：   
Dart
abstract class Pair {
  get first;
  get second;
  plus();
}

class ArrayPair implements Pair {
  var _rep;
  ArrayPair(a, b) {
    _rep = [a, b];
  }
  get first => _rep[0];
  get second => _rep[1];
  plus() {
    return 'first: ${this.first}; sencond: ${this.second}';
  }
}

Pair reversePair(Pair p) => new ArrayPair(p.second, p.first);

main(List args) {
  Pair _reversePair = reversePair(new ArrayPair(3, 4));
  print(_reversePair.plus());
}


TypeScript
interface PairConstructor {
  new (p1, p2): Pair
}

interface Pair {
  first: any
  second: any
  plus(): string
}

class ArrayPair implements Pair {
  private _rep: Array
  constructor(a, b) {
    this._rep = [a, b]
  }
  get first() {
    return this._rep[0]
  }
  get second() {
    return this._rep[1]
  }
  plus() {
    return `first: ${this.first}; sencond: ${this.second}`
  }
}

const reversePair = (p: PairConstructor, first, second) => new p(first, second)

const _reversePair = reversePair(ArrayPair, 3, 4)
console.log(_reversePair.plus())


但是如果我们省略了implements子句，则类型检查器将不知道ArrayPair是Pair的子类型。在这种情况下，类型检查器会对reversePair()的定义及使用发出警告。类似的警告信息也会出现在方法的调用处，因为方法的实际参数的类型是ArrayPair，而形式参数的类型是Pair。   
implements子句中列出的每个接口都被认为是当前类的直接父接口（可赋值性）。在上面的例子中，Pair是ArrayPair的直接父接口。此外，类的父类（继承关系）也被认为是类的直接父接口之一。   
在值传递的过程中，类型检查器并不强制要求变量之间有父接口关系，它检查的是可赋值性。可赋值性比继承关系更为宽松。只要两个类型之间存在父子关系，Dart就认为它们可以互相赋值。也就是说，不仅ArrayPair可以赋值给Pair(因为ArrayPair是Pair的子类型)，Pair也可以赋值给ArrayPair。看看下面的例子：   
Dart
class Monster {
  // 大量的功能实现
}

class Vampire extends Monster {
  get bloodType => '0';
}

Map monsters = {
  'Frankenstein': new Monster(),
  'Godzilla': new Monster(),
  'Dracula': new Vampire()
};

Vampire vamp = monsters['Dracula'];


TypeScript
class Monster {
  // 大量的功能实现
}

class Vampire extends Monster {
  get bloodType() {
    return '0'
  }
}

const monsters = new Map()
monsters.set('Frankenstein', new Monster())
monsters.set('Godzilla', new Monster())
monsters.set('Dracula', new Vampire())

const vamp: Vampire = monsters['Dracula'];


上面的例子充分展示了继承关系的概念，这有点类似其它语言中的装箱和拆箱概念，虽然monsters这个map内部只能存放Monster实例，但是我们却赋值了一个Vampire实例。相同地，我们从该map取值的时候理论上也应该Monster类型实例，但是我们却给他赋值了Vampire。这是一个非常典型的类型隐形向下转换的概念。

type/function-type.html.body:
函数类型

为函数定义类型

在Dart中，函数类型被特殊对待。所有函数都实现了Function，但函数类型之间的比较是基于它们的结构。      
函数的类型是基于它的返回值和形式参数的类型。该类型反映了参数是命名型还是位置型，位置参数是否必填，以及命名参数的名称。      
函数类型的定义是在Dart2中开始支持的。使用typedef关键字来定义。              
让我们来看一个函数添加类型的示例：      
Dart
typedef num Add(num x, num y);

// typedef void AddVoid(num x, num y);
typedef AddVoid(num x, num y); // 与上面的注释是等效的

main(List args) {
  // Add myAdd = (int x, num y) => x + y;  // The function expression type '(int, num) → num' isn't of type '(num, num) → num'. This means its parameter or return type does not match what is expected. Consider changing parameter type(s) or the returned type(s).
  Add myAdd = (num _x, num y) => _x + y;
  print(myAdd(1, 2)); // 3

  AddVoid myAddVoid = (num _x, num y) => { print('void') };
  myAddVoid(1, 2); // void
}


TypeScript
// expression 1:
const myAdd: (x: number, y: number) => number = (_x: number, y: number) => _x + y

// expression 2:
const myAdd2: {(x: number, y: number): number} = (_x: number, y: number) => _x + y

const myAddVoid: (x: number, y: number) => void = (_x: number, y: number) => console.log('void')

console.log(myAdd(1, 2))  // 3
console.log(myAdd2(1, 2))  // 3
myAddVoid(1, 2); // void


这里，我们做了一些尝试，myAdd的类型是Add，Add的函数类型可以看做是(num, num) => num。而我们第一次尝试让myAdd的类型表示为(int, num) => num，但是编译器并不能通过我们的代码，虽然int是num的子类，但是编译器认为它们是两个不同的类型，这也就验证了函数的类型是基于它的返回值和形式参数的类型来断定的。      
而我们第二次又对myAdd做了一次尝试，这次把Add中的x形参名称改成了_x，编译器尽然通过了。这个问题表现出，函数类型包含两部分：参数类型和返回值类型。当写出完整函数类型的时候，这两部分都是必须的。只要参数类型是匹配的，那么就认为它是有效的函数类型，而不在乎参数名是否正确。    
第二部分是返回值类型。 对于返回值，我们在函数和返回值类型之前使用( =>)符号，使之清晰明了。 如之前提到的，返回值类型是函数类型的必要部分，如果函数没有返回任何值，你也必须指定返回值类型为 void或留空。(在TS中必须制定返回类型为void且不能留空)      
可选参数和默认参数
Dart
// typedef Optional(int x, [int y = 1]);  // Default parameter values aren't allowed in typedefs
typedef int Optional(int x, [int y]);

main() {
  Optional myOptional = (int x, [int y = 1]) => x + y;
  print(myOptional(2)); // 3
  print(myOptional(2, 3)); // 5
}


TypeScript
const myOptional: {(x: number, y?: number): number} = (x: number, y: number = 1) => x + y

console.log(myOptional(2))  // 3
console.log(myOptional(2, 3))  // 5


typedef不允许定义默认参数，但是允许定义可选参数（同样在ts中默认参数也只允许定义在函数或构造函数中，无法使用在类型定义中）。但是在函数定义中是允许定义默认参数的。因此在myOptional函数中通过函数类型来定义可选参数y，同时在函数声明又使用了默认参数来定义y，从而同时实现了可选参数和默认参数的语法特性。      
另外有一点不得不说明下，在Dart的函数声明中是允许可选参数和默认参数的共同声明的，但是在TS中是不允许共同声明的，这是这两个语言的区别。       
命名参数
需要详细了解概念可查看“函数 - 参数”这一章节，下面来看看如何使用函数类型的方式来约束命名参数的类型检查：     
Dart
typedef String Named(int x, {int y, String z});

main() {
  Named myNamed = (int x, {int y, String z = 'zoo'}) => (x + y).toString() + z;
  print(myNamed(1, y: 2));  // 3zoo
  print(myNamed(1, y: 2, z: 'hi'));  // 3hi
}


TypeScript
const myNamed = (x: number, {y, z = 'zoo'}: {y: number, z?: string}) => x + y + z

console.log(myNamed(1, {y: 2})) // 3zoo
console.log(myNamed(1, {y: 2, z: 'hi'})) // 3hi

type/generics.html.body:
泛型
在定义函数、接口或类的时候，不预先指定具体的类型，而在使用的时候再指定类型的一种特性。       
软件工程中，我们不仅要创建一致的定义良好的API，同时也要考虑可重用性。 组件不仅能够支持当前的数据类型，同时也能支持未来的数据类型，这在创建大型系统时为你提供了十分灵活的功能。     
在像C#和Java这样的语言中，可以使用泛型来创建可重用的组件，一个组件可以支持多种类型的数据。 这样用户就可以以自己的数据类型来使用组件。     
泛型之Hello World
下面来创建第一个使用泛型的例子：echo函数。 这个函数会返回任何传入它的值。       
不用泛型的话，这个函数可能是下面这样：              
Dart
int echoInt(int arg) {
  return arg;
}

echo(arg) {
  return arg;
}

main(List args) {
  // 只能打印整数型
  print(echoInt(123));

  // 可打印任何类型
  print(echo('123'));
}


TypeScript
function echoInt(arg: number): number {
  return arg
}

function echo(arg: any): any {
  return arg
}

// 只能打印整数型
console.log(echoInt(123))

// 可打印任何类型
console.log(echo('123'))


使用dynamic类型会导致这个函数可以接收任何类型的arg参数，这样就丢失一些信息：传入的类型与返回的类型应该是相同的。如果我们传入一个数字，我们只知道任何类型的值都有可能被返回。     
因此，我们需要一种方法使返回值的类型与传入参数的类型是相同的。 这里，我们使用了类型变量，它是一种特殊的变量，只用于表示类型而不是值。         
Dart
T echo(T arg) {
  return arg;
}


TypeScript
function echo(arg: T): T {
  return arg
}


我们给echo添加了类型变量T。 T帮助我们捕获用户传入的类型（比如：int），之后我们就可以使用这个类型。 之后我们再次使用了 T当做返回值类型。现在我们可以知道参数类型与返回值类型是相同的了。 这允许我们跟踪函数里使用的类型的信息。      
我们把这个版本的echo函数叫做泛型，因为它可以适用于多个类型。 不同于使用 dynamic，它不会丢失信息，像第一个例子那像保持准确性，传入数值类型并返回数值类型。        
我们定义了泛型函数后，可以用两种方法使用。 第一种是，传入所有的参数，包含类型参数：       
echo('123')

这里我们明确的指定了T是String类型，并做为一个参数传给函数，使用了<>括起来而不是()。    
第二种方法更普遍。利用了类型推论 -- 即编译器会根据传入的参数自动地帮助我们确定T的类型：       
echo('123')

注意我们没必要使用尖括号（<>）来明确地传入类型；编译器可以查看arg的值，然后把T设置为它的类型。 类型推论帮助我们保持代码精简和高可读性。如果编译器不能够自动地推断出类型的话，只能像上面那样明确的传入T的类型，在一些复杂的情况下，这是可能出现的。         
使用泛型变量
使用泛型创建像echo这样的泛型函数时，编译器要求你在函数体必须正确的使用这个通用的类型。 换句话说，你必须把这些参数当做是任意或所有类型。      
如果我们想同时打印出arg的长度。 我们很可能会这样做：       
T echo(T arg) {
  print(arg.length);  // The getter 'length' isn't defined for the class 'Object'.
  return arg;
}

如果这么做，编译器会报错说我们使用了arg的.length属性，但是没有地方指明arg具有这个属性。 记住，这些类型变量代表的是任意类型，所以使用这个函数的人可能传入的是个数字，而数字是没有 .length属性的。        
现在假设我们想操作T类型的数组而不直接是T。由于我们操作的是数组，所以.length属性是应该存在的。 我们可以像创建其它数组一样创建这个数组：         
Dart
List loggingIdentity(List arg) {
  print(arg.length);
  return arg;
}

main(List args) {
  List lists = [];
  lists..add(1)..add('2');
  loggingIdentity(lists); // 2
}


TypeScript
function loggingIdentity(arg: Array): Array {
  console.log(arg.length)
  return arg
}

const lists = []
lists.push(1)
lists.push('2')
loggingIdentity(lists)  // 2


你可以这样理解loggingIdentity的类型：泛型函数loggingIdentity，接收类型参数T和参数arg，它是个元素类型是T的数组，并返回元素类型是T的数组。 如果我们传入数字数组，将返回一个数字数组。      
泛型类
泛型类使用（ <>）括起泛型类型，跟在类名后面。     
Dart
typedef Add = T Function(T x, T y);

class GenericNumber {
  T zeroValue;
  Add add; // dart2开始支持 函数类型 语法特性
}

main(List args) {
  var myGenericNumber = new GenericNumber();
  myGenericNumber.zeroValue = 0;
  myGenericNumber.add = (int x, int y) => x + y;
  print(myGenericNumber.add(myGenericNumber.zeroValue, 3)); // 3
}


TypeScript
class GenericNumber {
  zeroValue: T
  add: (x: T, y: T) => T
}

var myGenericNumber = new GenericNumber();
myGenericNumber.zeroValue = 0
myGenericNumber.add = (x: number, y: number) => x + y
console.log(myGenericNumber.add(myGenericNumber.zeroValue, 3))  // 3


GenericNumber类的使用是十分直观的，并且你可能已经注意到了，没有什么去限制它只能使用int类型。 也可以使用字符串或其它更复杂的类型。         
Dart
main(List args) {
  var stringNumeric = new GenericNumber();
  stringNumeric.zeroValue = '0';
  stringNumeric.add = (String x, String y) => x + y;
  print(stringNumeric.add(stringNumeric.zeroValue, '3')); // 03
}


TypeScript
var stringNumeric = new GenericNumber();
stringNumeric.zeroValue = '0'
stringNumeric.add = (x: String, y: String) => `${x}${y}`
console.log(stringNumeric.add(stringNumeric.zeroValue, '3'))  // 03


注：类有两部分：静态部分和实例部分。 泛型类指的是实例部分的类型，所以类的静态属性不能使用这个泛型类型。        
泛型约束
你应该会记得之前的一个例子，我们有时候想操作某类型的一组值，并且我们知道这组值具有什么样的属性。 在 loggingIdentity例子中，我们想访问arg的length属性，但是编译器并不能证明每种类型都有length属性，所以就报错了。       
相比于操作dynamic所有类型，我们想要限制函数去处理任意带有.length属性的所有类型。 只要传入的类型有这个属性，我们就允许，就是说至少包含这一属性。 为此，我们需要列出对于T的约束要求。         
为此，我们定义一个接口来描述约束条件。 创建一个包含 .length属性的接口，使用这个接口和extends关键字来实现约束：      
Dart
abstract class Lengthwise {
  int length;
}

class LengthwiseObj extends Lengthwise {}

T loggingIdentityExtend(T arg) {
  print(arg.length);
  return arg;
}

main() {
  loggingIdentityExtend(new LengthwiseObj()..length = 5); // 5
}


TypeScript
abstract class Lengthwise {
  length: number;
}

class LengthwiseObj extends Lengthwise {}

function loggingIdentityExtend(arg: T): T {
  console.log(arg.length)
  return arg
}

const lengthwiseObj = new LengthwiseObj()
lengthwiseObj.length = 5
loggingIdentityExtend(lengthwiseObj)  // 5
// TS同时还支持字面量相似规则
loggingIdentityExtend({length: 5, value: 3})  // 5
loggingIdentityExtend("12345")  // 5
loggingIdentityExtend([1, 2, 3, 4, 5])  // 5


现在这个泛型函数被定义了约束，因此它不再是适用于任意类型。     

在Dart中，extends识别类型；在TS中，extends则识别字面量，即我们需要传入符合约束类型的值，必须包含必须的属性。从这点设计上来说，TS的思想更加先进点。
